goed

met Joe Manganiello, Ken Anderson en Keith David

Het is een vreselijke chaos in Colombia. Er vindt een oorlog plaats tussen de regering, en guerrilla's. Een speciaal team wordt 
ingezet: de U.S. Navy SEALS. Hun taak is een geheime ontmoeting te observeren en deze in de gaten te houden. Maar dan wordt de 
hele boel onder vuur genomen en worden de twee leiders vermoord. Nu zitten de SEALS in de val, ze zullen moeten overleven en hun 
onschuld zien te bewijzen.:
